// Blog_main.js
import React from 'react';

const Blog_main = ({ name, surname, avatarUrl }) => {
  return (
    <section className="blog">
      <div className="blog-header">
        <img className="ava" src={avatarUrl} alt="Blogger Avatar" />
        <h4 className="blog-name">{`${name} ${surname}`}</h4>
        <button className="delete">
          <img src="/img/delete.png" alt="Delete Blog" />
        </button>
      </div>
      <div className="blog-content">
        {/* Вставьте другие данные блога, которые вы хотите отобразить */}
      </div>
      <div className="buttons">
        <button>
          <img src="/img/like.png" alt="Like" />
        </button>
        <button>
          <img src="/img/dislike.png" alt="Dislike" />
        </button>
        <button>
          <img src="/img/save.png" alt="Save" />
        </button>
      </div>
    </section>
  );
};

export default Blog_main;
